export const { styled, css } = createStyled({
  breakpoints: {},
  tokens: {
    colors: {
      $primary: "navy",
      $secondary: "blue",
      $destructive: "#9b1010",
      $constructive: "#178917",
    },
  },
  utils: {},
});
